import React from "react";
import ReactDOM from "react-dom";
import css from "./index.css";

var oneSecond = 1000; // one second same as 1000ms
var counterTimer = 25 * 60; //timedown minutes
var mm = counterTimer / 60; //minutes
var ss = counterTimer % 60; //seconds


function startTimer() {}

function stopTimer() {}

function pauseTimer() {}

class Timer extends React.Component {
  render() {
    
    return (
      <div className="timer">
        <span>{mm}</span>
        <span>:</span>
        <span>{ss}</span>
      </div>
    );
  }
}

ReactDOM.render(<Timer />, document.getElementById("root"));
